    const renderSwitch = (activeTab) => {
        switch (activeTab) {
            case "home":
                return <HomePage />;
            case "research":
                return <HomePage />;
            case "lab":
                return <HomePage />;
            case "news":
                return <HomePage />;
            case "teaching":
                return <HomePage />;
            default:
                return;

        }
    }
    return (
        <div>
            {renderSwitch(activeTab)}
        </div>
    )
}
